import React, { useEffect, useState } from 'react'

const ListItem = () => {
    const [list, setList] = useState([])
    const [post, setPost] = useState([])
    const [error, setError] = useState(null)
    useEffect(()=> {
        fetch("https://jsonplaceholder.typicode.com/users")
        .then((res) => res.json())
        .then((data) => setList(data.map(list => list.name)))
        .catch((err) => setError("something went wrong"))
    })
    useEffect(()=> {
        fetch("https://jsonplaceholder.typicode.com/posts")
        .then((res) => res.json())
        .then((data) => setPost(data.map(list => list.name)))
        .catch((err) => setError("something went wrong"))
    })

  return (
    <div>
        <h3>ListItem</h3>
        {error && <p>{error}</p>}
        <ul>
            {list.map((list) => (
                <li key={list}>{list}</li>
            ))}
        </ul>
        <h3>ListItems</h3>
        {error && <p>{error}</p>}
        <ul>
            {post.map((list) => (
                <li key={list}>{list}</li>
            ))}
        </ul>


    </div>
  )
}

export default ListItem
